namespace Markdown_Image_2_Base64.Test
{
  using NUnit.Framework;

  public class Image2Base64ConverterTests
  {
    [Test]
    public void ImageBase64ConverterShouldReturnCorrectBase64String()
    {
      var converter = new Image2Base64Converter("/Users/zhixin/Personal/2021_Business_Oriented_Design/notes/1");
      var base64 = converter.GetBase64("./业务与领域1.png");
      Assert.AreEqual(
        expected,
        base64);
    }

    private string expected =
      "data:image/png;base64,";
  }
}